function Button({ 
    children,
    primary,
    secondary,
    success,
    warning,
    danger, 
    rounded,
    outline
}){
    return <button className="px-3 py-1.5 border border-blue-500 bg-blue-500 text-white">{children}</button>;
}

Button.propTypes = {
    checkVariationValue: ({ primary, secondary, success, warning, danger, rounded, outline }) => {
        const count = 
            Number(!!primary) +
            Number(!!secondary) +
            Number(!!warning) +
            Number(!!success) +
            Number(!!danger);

            if(count > 1){
                return new Error('Only one of primary, secondary, sucess, warning, danger can be true');
            }
    }
}

export default Button;
